(9, 'Hello tickets!', '<p>Opening Date: 25/NOV/2022</p>', 2, 1666330219, 3, 23, 43, 1668975709, '', '', 'images/news/announcement.jpg', 0),
(10, 'Sonora-Global', '<p>Be ready to feel the experience of playing tibia global with higher exp :)</p>', 1, 1668969194, 1, 38, 43, 1668976063, 'https://my-aac.org', '', 'images/news/announcement.jpg', 0),
