(17, 'Hola', '<p>sonoraglobal.com</p>', 3, 1668976094, 1, 43, 43, 1668976111, '0', '', 'images/news/announcement.jpg', 0),
(18, 'Confirmed Streamers!!', '<ul>\r\n<li style=\"text-align: left;\"><strong>TurcoSerafan</strong></li>\r\n<li style=\"text-align: left;\"><strong>Hegal</strong></li>\r\n<li style=\"text-align: left;\"><strong>Adicto</strong></li>\r\n</ul>\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></p>\r\n<p><strong><img src=\"https://mx.images.search.yahoo.com/search/images;_ylt=AwrFNt3tvntj8tsGLinD8Qt.;_ylu=Y29sbwNiZjEEcG9zAzEEdnRpZAMEc2VjA3BpdnM-?p=hegal+tibia&amp;fr2=piv-web&amp;type=E211MX1406G0&amp;fr=mcafee#id=0&amp;iurl=https%3A%2F%2Fi.ytimg.com%2Fvi%2Fd6sVzT79ECo%2Fmaxresdefault.jpg&amp;action=click\" alt=\"\" /></strong></p>', 1, 1669053868, 1, 43, 43, 1669161827, '0', '', 'images/news/announcement.jpg', 0),
(19, 'Updates', '<h1 style=\"text-align: center;\"><span style=\"color: #ff0000;\">SUMMER UPDATE</span></h1>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://tiblioteca.com/wp-content/uploads/2022/07/2022_updatenews_web1307.jpg\" /></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://i.ytimg.com/vi/b3IgO8s32AE/maxresdefault.jpg\" width=\"475\" height=\"475\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://i.ytimg.com/vi/bnDkYv7bY-0/maxresdefault.jpg\" width=\"475\" height=\"475\" /></p>\r\n<p>&nbsp;</p>', 1, 1669094805, 1, 43, 43, 1669095369, '0', '', 'images/news/announcement.jpg', 0),
(20, 'Store  Upgrades', '<p><strong>Tibia Drome Potions, Cupcake&nbsp; Foods, Infinite Loot Bag, Ultimate Teleport Scroll were added to the store</strong></p>', 2, 1669145837, 1, 43, 43, 1669145883, '0', '', 'images/news/announcement.jpg', 0),
(21, 'Updates Avatars (Revelation Perk)', '<p><strong>Next Updates Sonora:&nbsp; &nbsp;</strong><img style=\"float: right;\" src=\"https://static.tibia.com/images/news/updatetreewinter135x135.png\" /><strong><br />&nbsp; &nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>The new Client could be ready the next Sunday</strong></p>\r\n<p>&nbsp; &nbsp;<span style=\"text-align: center;\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"text-align: center;\">&nbsp; &nbsp; &nbsp;&nbsp;</span><img src=\"https://static.tibia.com/images/news/avatar_sorc_storm.gif\" /><span style=\"text-align: center;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><img src=\"https://static.tibia.com/images/news/avatar_pala_light.gif\" />&nbsp; &nbsp; &nbsp;&nbsp;<img src=\"https://static.tibia.com/images/news/avatar_druid_nature.gif\" />&nbsp; &nbsp; &nbsp; &nbsp;<img src=\"https://static.tibia.com/images/news/avatar_knight_steel.gif\" /></p>\r\n<p>&nbsp;</p>\r\n<p>very soon we will have <strong>Wheel of Destiny</strong> but you can enjoy their new outfit and mounts</p>', 1, 1669579545, 1, 43, 43, 1669579790, '0', '', 'images/news/announcement.jpg', 0);
